# 2157. Groups of Strings
# https://leetcode.com/problems/groups-of-strings/

import time
import sys
from collections import Counter
import array
MASK_BITS = 26

class UnionFind():
    def __init__(self, size):
        self.match = array.array("I", list(range(0,size)))
        self.sz = array.array("I", [1]*size)

    def find(self, root):
        while root != self.match[root]:
            root = self.match[root]
        return root

    def union(self, a, b):
        root_a = self.find(a)
        root_b = self.find(b)
        if root_a == root_b:
            return
        if self.sz[root_a] > self.sz[root_b]:
            self.match[root_b] = root_a
        else:
            self.match[root_a] = root_b
            self.sz[root_b] += 1

class Solution:
    ord_a = ord("a")

    def word_to_bin(self, word):
        """Переводим слово в бинарную маску"""
        # word = "".join(sorted(word))
        bin_word = 1<<MASK_BITS+1
        for l in word:
            index = ord(l) - self.ord_a
            bin_word |= 1<<index
        return bin_word


    def groupStrings(self, words, log = False):

        words = sorted(words, key= (lambda x: len(x)), reverse = False)
        bin_words = array.array("I", [self.word_to_bin(w) for w in words])
        bin_words = sorted(bin_words, reverse = False)
        # Если все слова в массиве состоят из 25 букв алфавита (всего 26) значит все слова относятся к одной группе
        # т.к. условие замены одного символа на другой по умолчанию выполняется, и поиск делать не надо,
        if len(words[0]) == MASK_BITS-1 and  len(words[-1]) == MASK_BITS-1:
            return [1, len(words)]
        set_bin_words = set(bin_words)
        dict_bin_words = {w:i for i, w in enumerate(bin_words)}

        uf = UnionFind(len(bin_words))

        # Проверка всех вариантов изменений
        for i,w1 in enumerate(bin_words):

            # Для проверки замены символа, сначала "обнуляем" символы в изначальном слове и далее проходим по всем возомжным изменениям битвой маски
            temp = w1<<1
            for c in range(MASK_BITS+1):
                temp = temp>>1
                if temp&1 == 1:
                    change_w1 = w1^(1<<c)
                # elif c == 26:
                elif c >= 26:
                    change_w1 = w1
                else:
                    continue

                for bits_two in range(MASK_BITS):
                    find_bin = change_w1^(1<<bits_two)
                    if find_bin in set_bin_words:
                        j = dict_bin_words.get(find_bin)
                        if j > i:
                            uf.union(i,j)


        aggr = Counter([uf.find(x) for x in range(len(words))])
        max_size_group = max(aggr.values())
        count_groups = len(aggr)
        return [count_groups, max_size_group]


